from fastapi.testclient import TestClient
from backend.main import app
from sqlalchemy import create_engine
from sqlalchemy.orm import sessionmaker
from backend.db.database import Base, pdf_db_connect
import pytest

# Create a test database using SQLite
test_engine = create_engine("sqlite:///./test.db", connect_args={"check_same_thread": False}, pool_size=20, max_overflow=20)
TestingSessionLocal = sessionmaker(autocommit=False, autoflush=False, bind=test_engine)

# Setup and teardown for database
@pytest.fixture(scope="module")
def db_session():
    Base.metadata.create_all(bind=test_engine)
    db = TestingSessionLocal()
    try:
        yield db
    finally:
        db.close()
        Base.metadata.drop_all(bind=test_engine)

# Override the get_db dependency
app.dependency_overrides[pdf_db_connect] = lambda: db_session().__next__()

client = TestClient(app)

def test_read_root():
    response = client.get("/")
    assert response.status_code == 200
    assert response.json() == {"status_code": 200, "message": "App is working good !!"}


def test_upload_file(db_session):
    payload = {
                "filename": "med_pdf.pdf",
                "base64": ""
            }
    response = client.post("/upload_file", json=payload)
    assert response.status_code == 200
    assert response.json()['message'] == "Data has been extracted from PDF and Embeddings has been saved in DB!!"


def test_get_all_files(db_session):
    response = client.get("/get_all_files")
    assert response.status_code == 200
    assert len(response.json()['details']) > 0
    assert response.json()['details'][0]['filename'] == "med_pdf.pdf"


